import { Absence } from "./absence.model";
import { Test } from "./test.model";

export class Student {
    id: number;
    name: string;
    family: string;
    addres: string;
    phon: string;
    avg: number;
    dateLeave: Date|undefined;
    active?: boolean;
    year?: YearS;
    tests?: Test[];
    absenceDays?: Absence[];
    constructor(name: string = "", id: number = 0, family: string, addres: string, phon: string,  avg: number, dateLeave: Date|undefined,active:boolean, tests: Test[], absenceDays: Absence[]) {
        this.id = id;
        this.name = name;
        this.addres = addres;
        this.avg = avg;
        this.phon = phon;
        this.family = family;
        this.active=active;
        this.dateLeave = dateLeave;
        this.tests = tests;
        this.absenceDays = absenceDays;
    }

}

export enum YearS {
    First,
    Second,
    Third
}
